detaileddescription.para:
Invoking this macro inside a class body causes the class operator new to push two TfAutoMallocTag objects onto the stack before actually allocating memory for the class. The names passed into the tag are used for the two tags; pass NULL if you don't need the second tag. For example, classMyBigMeshVertex{
public:
TF_MALLOC_TAG_NEW("MyBigMesh","Vertex");
...
}
 will cause dynamic allocations of MyBigMeshVertex to be grouped under the tag Vertex which is in turn grouped under MyBigMesh. However, classMyBigMesh{
public:
TF_MALLOC_TAG_NEW("MyBigMesh",NULL);
...
}
 specifies NULL for the second tag because the first tag is sufficient.
